    return (
        <div className="container">
            <form>
                <legend>Play Filters</legend>
                <label>Title</label>
                <input type="text"></input>
                <label>Year</label>
                <input type="radio"/><label>Before</label><input type="text"></input>
                <input type="radio"/><label>After</label><input type="text"></input>
                <label>Genre</label>
